import React from 'react';
import './Cart.css';

// Will take in Product name and price
function Cart(props) {

    return (

    <div>
        <div className="cart">
            <h2>Cart Items</h2>
            <div className="top-cart">
                <p className="p_name">Product Name{props.CartProductName}</p>
                <p className="p_price">Product Price ${props.CartProductPrice}</p> 
            </div>
            <div className="bottom-cart">
                <button>Checkout</button>
            </div>
        </div>
    </div>

    );
}

export default Cart;
